#include <cstdint>
#include <cstdlib>
#include <cstring>
#include <fuzzer/FuzzedDataProvider.h>
#include <tiffio.h>

extern "C" int LLVMFuzzerTestOneInput(const uint8_t *data, size_t size) {
    // Initialize FuzzedDataProvider with input data
    FuzzedDataProvider fuzzed_data(data, size);

    // Consume a random length string for the filename
    std::string filename = fuzzed_data.ConsumeRandomLengthString(100);
    if (filename.empty()) {
        // Ensure filename is not empty
        filename = "default_filename.tiff";
    }

    // Consume a random length string for the mode
    std::string mode = fuzzed_data.ConsumeRandomLengthString(10);
    if (mode.empty()) {
        // Ensure mode is not empty
        mode = "r";
    }

    // Call the function-under-test
    TIFF *tiff = TIFFOpen(filename.c_str(), mode.c_str());

    // If tiff is successfully opened, close it
    if (tiff != nullptr) {
        TIFFClose(tiff);
    }

    return 0;
}

#include <cstdint>
#include <cstdlib>
#include <string>
#include <fuzzer/FuzzedDataProvider.h>
#include <tiffio.h>

extern "C" int LLVMFuzzerTestOneInput(const uint8_t *data, size_t size) {
    FuzzedDataProvider fuzzed_data(data, size);

    // Generate a random string for the filename
    std::string filename = fuzzed_data.ConsumeRandomLengthString(256);
    // Generate a random string for the mode (e.g., "r", "w", "a")
    std::string mode = fuzzed_data.ConsumeRandomLengthString(10);

    // Ensure the mode string is not empty
    if (mode.empty()) {
        mode = "r"; // Default to read mode if empty
    }

    // Call the function-under-test
    TIFF* tiff = TIFFOpen(filename.c_str(), mode.c_str());

    // If TIFFOpen returns a valid pointer, close it
    if (tiff != nullptr) {
        TIFFClose(tiff);
    }

    return 0;
}
